import React, { Fragment, Component } from 'react';
import Slider from "react-slick";
import "slick-carousel/slick/slick.css"
import "slick-carousel/slick/slick-theme.css"
import { Box } from "rbx"
import { Link } from 'react-router-dom'

import "../../styles/categories.scss";
import slickSettings from "./slick_settings";

class Categories extends Component {
    constructor(props) {
        super(props)
        this.state = {
            categories: [
                {
                    'title': 'japonesa',
                    'image_url': 'data:image/jpeg;base64,'
                },
                {
                    'title': 'arabe',
                    'image_url': 'https://statig3.akamaized.net/bancodeimagens/ag/qm/g2/agqmg2pevkwzo2xb0m1aftc7j.jpg',
                },
                {
                    'title': 'vegana',
                    'image_url': 'https://www.superbom.com.br/blog/wp-content/uploads/2018/03/culinaria-vegana-para-esportistas-como-aproveitar-os-alimentos-ao-maximo.png',
                },
                {
                    'title': 'italiana',
                    'image_url': 'https://st3.depositphotos.com/1373322/12647/i/950/depositphotos_126479576-stock-photo-italian-food-pasta-with-meatballs.jpg',
                },
                {
                    'title': 'chinesa',
                    'image_url': 'https://abrilclaudia.files.wordpress.com/2016/10/receita-yakissoba.jpg',
                },
                {
                    'title': 'peruana',
                    'image_url': 'data:image/jpeg;base64,',
                }
            ]
        }
    }

    render() {
        return (
            <Fragment>
                <h3 className="title is-size-4">Categorias</h3>
                <Box>
                    <Slider {...slickSettings}>
                        {this.state.categories.map(category => {
                            return (
                                <Link to={`/restaurants?categories=${category.title}`}>
                                    <div className="slider-item">
                                        <img src={category.image_url} alt="new" />
                                        <span>{category.title}</span>
                                    </div>
                                </Link>
                            )
                        })}
                    </Slider>
                </Box>
            </Fragment>
        )
    }
}

export default Categories;